func main() {
    getRlpHeader()

    // Create an IPC based RPC connection to a remote node
    client, err := getClient()
    if err != nil {
        fmt.Println(err)
        return
    }
    
    // Instantiate the contract and display its name
    pool, err := NewTestPool(common.HexToAddress(contractAddress), client)
    if err != nil {
        log.Fatalf("Failed to instantiate a test pool contract: %v", err)
    }
    name, err := pool.Version(nil)
    if err != nil {
        log.Fatalf("Failed to retrieve pool version: %v", err)
    }
    fmt.Println("pool version:", name)


    // Create an authorized transactor
    auth, err := bind.NewTransactor(strings.NewReader(key), "smartpool")
    if err != nil {
        log.Fatalf("Failed to create authorized transactor: %v", err)
    }
    
    // do registration
    txRegister, err := pool.Register(auth,big.NewInt(0))
    if err != nil {
        log.Fatalf("Failed to register to smart pool: %v", err)
    }
    fmt.Printf("Transfer pending: 0x%x\n", txRegister.Hash())

    // Don't even wait, check its presence in the local pending state
    time.Sleep(1000 * time.Millisecond) // Allow it to be processed by the local node :P
    
    
    // submit epoch
    merkle,_ := (big.NewInt(0)).SetString("f34cafdb92d8626451414882183e1211",16)
    txSubmitEpoch, err := pool.SetEpochData( auth,
                                            merkle, // merkle
                                            uint64(8388593), // size
                                            uint64(23), // depth
                                            big.NewInt(0) /* epoch */ );
    if err != nil {
        log.Fatalf("Failed to set epoch data to smart pool: %v", err)
    }
    fmt.Printf("Transfer pending: 0x%x\n", txSubmitEpoch.Hash())

    // Don't even wait, check its presence in the local pending state
    time.Sleep(1000 * time.Millisecond) // Allow it to be processed by the local node :P

    
    // submit claim
    min,_ := (big.NewInt(0)).SetString("5831e71fb00a73511db2eef0",16)
    max,_ := (big.NewInt(0)).SetString("5831e74f2cd4b5a05f2e651a",16)
    aug,_ := (big.NewInt(0)).SetString("a2367a06af1ee3a1e24ce69a1ade8818",16)    
    txSubmitClaim, err := pool.SubmitClaim(auth,
                                           big.NewInt(8), // num shares
                                           big.NewInt(989235), // difficulty
                                           min,
                                           max,
                                           aug );
    if err != nil {
        log.Fatalf("Failed to SubmitClaim to smart pool: %v", err)
    }
    fmt.Printf("Transfer pending: 0x%x\n", txSubmitClaim.Hash())

    // Don't even wait, check its presence in the local pending state
    time.Sleep(1000 * time.Millisecond) // Allow it to be processed by the local node :P

    
    
    // verify claim
    nonce,_ := (big.NewInt(0)).SetString("b00a73511db2eef0",16)
    txVerifyClaim, err := pool.VerifyClaim( auth,
                                            getRlpHeader(),
                                            nonce,
                                            big.NewInt(0),                                            
                                            getCacheElements(),
                                            getCacheBranches(),
                                            getAugCounters(),
                                            getAugHashes() );
    if err != nil {
        log.Fatalf("Failed to verify claim to smart pool: %v", err)
    }
    fmt.Printf("Transfer pending: 0x%x\n", txVerifyClaim.Hash())                                            
}
